import React from 'react';

const SocialLinks = () => {
  const socialIcons = [
    { name: 'Twitter', icon: 'fab fa-twitter', link: '#' },
    { name: 'GitHub', icon: 'fab fa-github', link: '#' },
    { name: 'TikTok', icon: 'fab fa-tiktok', link: '#' },
    { name: 'Instagram', icon: 'fab fa-instagram', link: '#' },
    { name: 'YouTube', icon: 'fab fa-youtube', link: '#' },
    { name: 'LinkedIn', icon: 'fab fa-linkedin', link: '#' },
    { name: 'Email', icon: 'fas fa-envelope', link: '#' },
  ];

  return (
    <div className="flex justify-center mt-4 space-x-4">
      {socialIcons.map((social) => (
        <a href={social.link} key={social.name} className="text-2xl text-white">
          <i className={social.icon}></i>
        </a>
      ))}
    </div>
  );
};

export default SocialLinks;
